import React from 'react';


function App() {


  const comment = {
    date: new Date(),
    text: "Hello",
    author: {
      name: 'Cesar',
      avatarUrl: 'https://img.fantaskycdn.com/ebb4a5b67a7cf83a322b6e6cf34f56ee_1080x.jpg'
    }
  }

  return (
    <div>
      <Header/>
      <Menu/>
      <Main/>
      <Article/>
      <Comment 
        date={comment.date}
        text={comment.text}
        author={comment.author} 
      />
      <Aside/>
      <Footer/>
      <h1>Tecnology & Programming!!!</h1>
      <hr/>
      <h2>Welcome {name}</h2>
      <h3>Age: {age}</h3>
      <button 
        onClick={ () => setName('Venturini')}>
          Alterar
      </button>
      <button onClick={ () => setAge('44')}>
        Alterar
      </button>
      <hr/>
      <h3>E-mail: {email}</h3>
      <button
        onClick={ () => setEmail('devfernandouk@gmail.com')}>
          Alterar
      </button>

    </div>
  );
}

export default App;
